		$.fn.serializeObject = function()
	  {
		var o = {};
		var a = this.serializeArray();
		$.each(a, function() {
        if (o[this.name]) {
            if (!o[this.name].push) {
                o[this.name] = [o[this.name]];
            }
            o[this.name].push(this.value || '');
        } else {
            o[this.name] = this.value || '';
        }
		});
		return o;
		};

		function formatFormData(Obj){
			var str="";
			for(var p in Obj){
				if(Obj.hasOwnProperty(p)){
					str += p + '=' + Obj[p] + '&';
				}
			}
			return str;
		};



